const maxAttempts = 3;
function validarBonosConError(attempt = 1, bonosInvalidos = new Set()) {
  cy.get('tr').then($rows => {
    let nuevosBonosInvalidos = new Set();
    $rows.each((_, row) => {
      const $row = Cypress.$(row);
      const tieneError = $row.find('svg.tabler-icon-info-triangle.text-primary').length > 0;
      if (tieneError) {
        const bono = $row.find('button.text-link').text().trim();
        if (bono) {
          nuevosBonosInvalidos.add(bono);
          cy.log(`Intento ${attempt}: Error de valuación en bono "${bono}"`);
        }
      }
    });
    nuevosBonosInvalidos.forEach(bono => bonosInvalidos.add(bono));
    if (nuevosBonosInvalidos.size > 0) {
      if (attempt < maxAttempts) {
        cy.wait(95000);
        cy.reload();
        cy.get('div.table-responsive').should('be.visible');
        validarBonosConError(attempt + 1, bonosInvalidos);
      } else {
        const listaBonos = Array.from(bonosInvalidos).join(', ');
        throw new Error(`Después de ${attempt} intentos no fue posible valuar los siguientes bonos: ${listaBonos}.`);
      }
    } else {
      cy.log('Todos los bonos están correctamente valuados.');
    }
  });
}
